Friedrich Engels
Origin of the Family,
Private Property, and the
State
Written: March-May, 1884;
First Published: October 1884, in Hottingen-Zurich;
Source: Marx/Engels Selected Works, Volume Three;
Translation: The text is essentially the English translation by Alick West published in 1942, but it
has been revised against the German text as it appeared in MEW [Marx-Engels Werke] Volume
21, Dietz Verlag 1962, and the spelling of names and other terms has been modernised;
Transcription/Markup: Zodiac/Brian Baggins;
Online Version: Marx/Engels Internet Archive (marxists.org) 1993, 1999, 2000.
